function ChatContent(props) {
    if (props.type == 1) {
        return (
            <li class="clearfix">
                <div class="message other-message float-right">{props.content}</div>
            </li>
        );
    } else {
        return (
            <li class="clearfix">
                <div class="message my-message">{props.content}</div>
            </li>
        );
    }
}

export default ChatContent;
